pragma solidity >=0.7.0 <0.9.0;
import './Auction.sol';

contract AuctionCreator{
    Auction[] public auctions;

    function creatAuction() public{
        Auction newAuction = new Auction(msg.sender);
        auctions.push(newAuction);
    }
}
